import {Link} from "react-router-dom";
import "../styles/Home.css"

const Home = () => {
    return (
        <div className="homePage">
            <div className="choiceDiv">
                <Link to="/give_help">
                    <div className="giveHelp">
                        Найти кому помочь
                    </div>
                </Link>
                <Link to="/take_help">
                    <div className="takeHelp">
                        Найти кто может помочь
                    </div>
                </Link>
            </div>
        </div>
    );
};

export default Home;
